import{_ as e,c as a,o as n,a as t}from"./app.412d8fc1.js";const g=JSON.parse('{"title":"Updating from V2 to V3","description":"","frontmatter":{},"headers":[{"level":2,"title":"Sheweny Client","slug":"sheweny-client","link":"#sheweny-client","children":[]},{"level":2,"title":"Managers","slug":"managers","link":"#managers","children":[{"level":3,"title":"Buttons manager","slug":"buttons-manager","link":"#buttons-manager","children":[]},{"level":3,"title":"Commands manager","slug":"commands-manager","link":"#commands-manager","children":[]},{"level":3,"title":"Events manager","slug":"events-manager","link":"#events-manager","children":[]},{"level":3,"title":"Inhibitors manager","slug":"inhibitors-manager","link":"#inhibitors-manager","children":[]},{"level":3,"title":"SelectMenus manager","slug":"selectmenus-manager","link":"#selectmenus-manager","children":[]}]},{"level":2,"title":"Structures","slug":"structures","link":"#structures","children":[{"level":3,"title":"Commands","slug":"commands","link":"#commands","children":[]},{"level":3,"title":"Events","slug":"events","link":"#events","children":[]},{"level":3,"title":"Inhibitors","slug":"inhibitors","link":"#inhibitors","children":[]}]}],"relativePath":"guide/topics/V2-V3.md","lastUpdated":1674986535000}'),r={name:"guide/topics/V2-V3.md"},o=t('<h1 id="updating-from-v2-to-v3" tabindex="-1">Updating from V2 to V3 <a class="header-anchor" href="#updating-from-v2-to-v3" aria-hidden="true">#</a></h1><p><strong>Full changelog is avaiable on <a href="https://github.com/Sheweny/framework/master/dev/CHANGELOG.md" target="_blank" rel="noreferrer">Github</a></strong></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The version 3.0.0 of Sheweny require discord.js version 13.3.0 or higher.</p></div><h2 id="sheweny-client" tabindex="-1">Sheweny Client <a class="header-anchor" href="#sheweny-client" aria-hidden="true">#</a></h2><p>The <code>handlers</code> option has been renamed to <code>managers</code>.<br> See <a href="./../../docs/typedef/ShewenyClientOptions.html">ShewenyClientOptions</a></p><p>The <code>util</code> property now return a <a href="./../../docs/client/ClientUtil.html">ClientUtil</a> class.</p><h2 id="managers" tabindex="-1">Managers <a class="header-anchor" href="#managers" aria-hidden="true">#</a></h2><h3 id="buttons-manager" tabindex="-1">Buttons manager <a class="header-anchor" href="#buttons-manager" aria-hidden="true">#</a></h3><ul><li>The options of <code>ButtonsManager</code> has been changed :</li></ul><p>The first parameter is the client and the second is an object with the <a href="./../../docs/typedef/ManagerOptions.html#basemanageroptions">BaseManagerOptions</a></p><ul><li>New methods :</li></ul><p><code>unloadAll()</code> to unload all buttons.<br> See <a href="./../../docs/managers/ButtonsManager.html#unloadall">ButtonsManager#unloadAll</a></p><h3 id="commands-manager" tabindex="-1">Commands manager <a class="header-anchor" href="#commands-manager" aria-hidden="true">#</a></h3><ul><li>The options of <code>CommandsManager</code> has been changed :</li></ul><p>The first parameter is the client and the second is an object with the <a href="./../../docs/typedef/ManagerOptions.html#commandsmanageroptions">CommandsManagerOptions</a></p><p>The <code>guildId</code> option now support an array of guild id.<br> See <a href="./../../docs/typedef/ManagerOptions.html#commandsmanageroptions#guildid">CommandsManagerOptions#guildId</a></p><ul><li>New options :</li></ul><p><code>autoRegisterApplicationCommands</code> for choose if the commands manager should automatically register the application commands.</p><ul><li>New methods :</li></ul><p><code>unloadAll()</code> to unload all commands.<br> See <a href="./../../docs/managers/CommandsManager.html#unloadall">CommandsManager#unloadAll</a></p><h3 id="events-manager" tabindex="-1">Events manager <a class="header-anchor" href="#events-manager" aria-hidden="true">#</a></h3><ul><li>The options of <code>EventsManager</code> has been changed :</li></ul><p>The first parameter is the client and the second is an object with the <a href="./../../docs/typedef/ManagerOptions.html#basemanageroptions">BaseManagerOptions</a></p><ul><li>New methods :</li></ul><p><code>unloadAll()</code> to unload all events.<br> See <a href="./../../docs/managers/EventsManager.html#unloadall">EventsManager#unloadAll</a></p><h3 id="inhibitors-manager" tabindex="-1">Inhibitors manager <a class="header-anchor" href="#inhibitors-manager" aria-hidden="true">#</a></h3><ul><li>The options of <code>InhibitorsManager</code> has been changed :</li></ul><p>The first parameter is the client and the second is an object with the <a href="./../../docs/typedef/ManagerOptions.html#basemanageroptions">BaseManagerOptions</a></p><ul><li>New methods :</li></ul><p><code>unloadAll()</code> to unload all inhibitors.<br> See <a href="./../../docs/managers/InhibitorsManager.html#unloadall">InhibitorsManager#unloadAll</a></p><h3 id="selectmenus-manager" tabindex="-1">SelectMenus manager <a class="header-anchor" href="#selectmenus-manager" aria-hidden="true">#</a></h3><ul><li>The options of <code>SelectMenusManager</code> has been changed :</li></ul><p>The first parameter is the client and the second is an object with the <a href="./../../docs/typedef/ManagerOptions.html#basemanageroptions">BaseManagerOptions</a></p><ul><li>New methods :</li></ul><p><code>unloadAll()</code> to unload all select-menus.<br> See <a href="./../../docs/managers/SelectMenusManager.html#unloadall">SelectMenusManager#unloadAll</a></p><h2 id="structures" tabindex="-1">Structures <a class="header-anchor" href="#structures" aria-hidden="true">#</a></h2><p>Every structures now have a <code>manager</code> property.</p><h3 id="commands" tabindex="-1">Commands <a class="header-anchor" href="#commands" aria-hidden="true">#</a></h3><p>In commands there is a new function <code>onAutocomplete()</code> for use the autocompletion with application commands.<br> See <a href="./../../docs/structures/Command.html#onautocomplete">Command#onAutocomplete</a>.</p><h3 id="events" tabindex="-1">Events <a class="header-anchor" href="#events" aria-hidden="true">#</a></h3><p>In events options there is a new property <code>emitter</code> for use a custom event emitter.<br> See <a href="./../../docs/structures/Event.html#emitter">Event#emitter</a></p><h3 id="inhibitors" tabindex="-1">Inhibitors <a class="header-anchor" href="#inhibitors" aria-hidden="true">#</a></h3><p>The parameters of the <code>execute()</code> and <code>onFailure()</code> methods has been changed : the first parameter is the client and the second is the context.<br> See <a href="./../../docs/structures/Inhibitor.html#execute">Inhibitor#execute</a> and <a href="./../../docs/structures/Inhibitor.html#onFailure">Inhibitor#onFailure</a> for more informations.</p>',43),s=[o];function i(l,d,h,c,m,u){return n(),a("div",null,s)}const f=e(r,[["render",i]]);export{g as __pageData,f as default};
